import React, { useState } from 'react';
import {fetchWatchlits} from "../../../Utilities/Data/Watchlist/Watchlist";
import WatchListTab from "./WatchListTab";

export default function SubHeader(props) {
    // Declare a new state variable, which we'll call "count"
    const [title, ToggleTitle] = useState(0);
    let Watchlists = fetchWatchlits();

    return (
       <div class="container max-w-full">

    <div className="flex flex-row bg-gray-200">
        <div className="">
            <header className="bg-gray-700 shadow">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 ">
                    <h1 className="text-3xl font-semibold leading-tight text-gray-100">
                        {props.title[title]}
                    </h1>
                    <button onClick={() => ToggleTitle(SwitchTitle(title))}>
                        Click me
                    </button>
                </div>
            </header>
        </div>
        {Watchlists.map(function(list,id){
            return(
                <WatchListTab watchlistname={list}/>
            )

        })


        }


    </div>

       </div>


    );
}

function SwitchTitle(value){

    if (value == 0){
        value = 1;
    }
        else {
        value = 0
    }
        return value;


}
